import './App.css';
import Checkout from './Checkout';
import Counter from './pages/Counter/Counter';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
      <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/checkout">checkout</Link>
            </li>
            <li>
              <Link to="/Counter">Counter</Link>
            </li>
          </ul>
        </nav>
        <Switch>
          <Route path="/checkout">
            <Checkout />
          </Route>
          <Route path="/counter">
            <Counter />
          </Route>

        </Switch>
      </Router>
    </div>
  );
}

export default App;
